import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Muutettu BrowserRouter -> Router
import './App.css';
import Home from './screens/Home'; 
import Charts from './screens/Charts';

const App = () => {
  return (
    <>
      <div>
        <Router> 
          <Routes>
            <Route path='/' element={<Home/>} />
            <Route path='/Home' element={<Home/>} /> 
            <Route path='/Charts' element={<Charts/>} />
          </Routes>
        </Router>
      </div>
    </>
  );
}

export default App;
